import React, { useState } from 'react';

import { introAndEndData } from './core.js';

import { Container } from 'react-bootstrap'

import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import Home from "./home.js";
import Stuff from "./textfiles.js";


import EtIDNav from './EtIDNav.js';
import EtIDSelection from './EtIDSelection.js';
import EtIDDownload from './EtIDDownload.js';
import EtIDHeader from './EtIDHeader.js';
import EtIDAdvSet from './EtIDAdvSet.js';
import EtIDFooter from './EtIDFooter.js';

window.onload = function() {
  introAndEndData();
};

const App = () => (
    <>

    <EtIDNav />
    <HashRouter>
            <div>
              <h1>Simple SPA</h1>
              <ul className="header">
                <li><NavLink to="/">Home</NavLink></li>
                <li><NavLink to="/textfiles">The Files</NavLink></li>
              </ul>
              <div className="content">
                <Route exact path="/" component={Home}/>
                <Route path="/textfiles" component={Stuff}/>
              </div>
            </div>
          </HashRouter>


    <Container fluid className="p-3">

      <EtIDHeader />
      <br />
      <EtIDSelection />
      <br />
      <EtIDDownload />
      <br />
      <EtIDAdvSet/>

    </Container>
    <EtIDFooter/>
   </>
    );


export default App;
